    "quotes": "Je pense que le moment est venu de vous dire ce que j’ai appris, d’en tirer une conclusion, non ? Et bien ma conclusion c’est que la haine est une saloperie ! La vie est trop courte pour passer son temps à avoir la haine ! Ça n’en vaut pas la peine. Derek dit toujours que c’est bien de terminer un devoir par une citation, il dit que quelqu’un a déjà dû en faire une bonne, si on ne peut pas faire mieux, autant la lui emprunter carrément ! J’ai choisi celle-là et j’espère qu’elle vous plaira :\n\n« Nous ne sommes pas ennemis, mais amis ! Nous ne devons pas être ennemis. Même si la passion nous déchire, elle ne doit pas briser l’affection qui nous lie. Les cordes sensibles de la mémoire vibreront dès qu’on les touchera, elles raisonneront au contact de ce qu’il y a de meilleur en nous. »\nAmerican History X",
